import React from "react"

function Joke(props){
    if(props.question!==undefined)
    {
        console.log(props.question);

    }
    return(
        <div className="joke">
            <p style = {{display: props.question ? "block" : "none" }}>Question: {props.question}</p>
            <p>Punch: {props.punch}</p>
        </div>
        
    )
    
}
export default Joke
